import styles from "./LoginForm.module.scss";

function LoginForm() {
  return (
    <div className={styles.container}>
      <form>
        <label>Email:</label>
        <input type="text" />
        <label>Password:</label>
        <input type="password" />
      </form>
    </div>
  );
}

export default LoginForm;
